//import React from 'react';
import './App.min.css';
import { Header } from './components/header/Header'
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';

export default  function App() {
  return (
    <body>
      <Router>
          <Header />
          <Routes>
            <Route path = "/" element = {<App />} />
          </Routes>
      </Router>
    </body>
  );
}
